import React, {Component} from "react";
import { Container, InfoDiv, InfoTitle, InfoBox} from "./step-item.styles";


class StepInfo extends Component{
    constructor(props){
        super(props)
    }

    render(){
        let {taskOwner} = this.props
        return(
            <Container>
                <InfoDiv>
                    <InfoTitle>
                        Task Owner
                    </InfoTitle>
                    <InfoBox>
                        {taskOwner}
                    </InfoBox>
                </InfoDiv>
            </Container>
        )
    }
}

export default StepInfo;
